import "./style.css";
import { useAuth0 } from "@auth0/auth0-react";

const SnippetTopBar = () => {
	const { user } = useAuth0();
	const { picture } = user;

	return (
		<div className="snippet-top-bar">
			<img src={picture} alt="PFP" className="profilePicture" />
		</div>
	);
};

export default SnippetTopBar;
